A FaciPay é uma carteira digital que permitirá efectuar e receber pagamentos a partir de um QR code ou número de telefone, gerar referências, carregar e descarregar o saldo em carteira para contas bancárias.

A tecnologia de Token, por exemplo, salva os dados do cartão do consumidor com segurança desde a primeira compra, seja no ecommerce ou no terminal. Assim, torna-se possível identificar o cliente em futuras interações e oferecer experiências personalizadas, como compras em um clique e ofertas customizadas de acordo com o histórico de transações.

Referência: é um recurso que um determinado utilizador pode recorrer para solicitar pagamentos, em que o mesmo precisa apenas informar dados específicos como: descrição e o montante que representa o valor a ser pago(E sendo que a mesma pode ser temporária ou permanente. Todo e qualquer utilizador FaciPay pode efectuar o pagamento de uma determinada referência a partir de sua aplicação móvel. Por duas formas: Leitura QR Code ou introdução da referência (código da referência).


Leitura QR Code: Permite o utilizador abrir a camera do dispositivo para leitura de QR que se encontra na galeria ou fazer uma leitura na hora.


Introdução da referência (código da referência): Utilizador tem a oportunidade de pagar uma referência digitado ela directamente na app, na opção de adição de referências.




